import{_ as n,o as r,c as s,z as e,a as t}from"./chunks/framework.9482e208.js";const b=JSON.parse('{"title":"§ 36-156.4 Virginia Food Access Investment Fund.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/36-156.4.md","filePath":"vacode/36-156.4.md"}'),o={name:"vacode/36-156.4.md"},a=e("h1",{id:"§-36-156-4-virginia-food-access-investment-fund",tabindex:"-1"},[t("§ 36-156.4 Virginia Food Access Investment Fund. "),e("a",{class:"header-anchor",href:"#§-36-156-4-virginia-food-access-investment-fund","aria-label":'Permalink to "§ 36-156.4 Virginia Food Access Investment Fund."'},"​")],-1),i=e("p",null,"There is hereby created in the state treasury a special nonreverting fund to be known as the Virginia Food Access Investment Fund. The Fund shall be established on the books of the Comptroller. All funds appropriated for such purpose and any gifts, donations, grants, bequests, and other funds received on its behalf shall be paid into the state treasury and credited to the Fund. Interest earned on moneys in the Fund shall remain in the Fund and be credited to it. Any moneys remaining in the Fund, including interest thereon, at the end of each fiscal year shall not revert to the general fund but shall remain in the Fund. Moneys in the Fund shall be used solely for the purposes of establishing collaborative and cooperative projects with public and private sector partners to improve food access in Virginia. The Fund shall be used to provide funding for the construction, rehabilitation, equipment upgrades, or expansion of grocery stores, small food retailers, or innovative food retail projects in underserved communities. Expenditures and disbursements from the Fund shall be made by the State Treasurer on warrants issued by the Comptroller upon written request signed by the Commissioner of the Department of Agriculture and Consumer Services.",-1),d=e("p",null,[t("2020, cc. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0956",target:"_blank",rel:"noreferrer"},"956"),t(", "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0957",target:"_blank",rel:"noreferrer"},"957"),t(".")],-1),l=[a,i,d];function c(h,u,p,f,m,g){return r(),s("div",null,l)}const _=n(o,[["render",c]]);export{b as __pageData,_ as default};
